  #should be city,country; for us city,state. we refer to the below as
  #"country" but for the US it should be "state".
  def lookup (*args)
    city, country = *args
    if country #disambigugted lookup; implicitly have city
      #try to get hash of city locations; if it fails (city not in list)
      #do a country lookup instead. both return nil on failure.
      city_locs = @tier_one_list.fetch(city, nil)
      if !city_locs
        return @tier_two_list.fetch(country, nil)
      end
      #if we got here then city was found -- try to find location of
      #that city for the requested country; on failure return the
      #country's location, if it exists
      return city_locs.fetch(country, nil) || @tier_two_list.fetch(country, nil)
    elsif city #just got a city name
      #try to find the requested city
      city_locs = @tier_one_hash.fetch(city, nil)
      if !city_locs
        return nil
      end
      #if we got here then city exists in list; pull the first
      #disambiguating location out of the subhash -- we are guaranteed
      #that a city exists in at least one country
      city_locs.each_value { |val| return val }
    else #no args passed
      return nil
    end
  end
  
  # return an array with the coordinates that match the location, using
  # class external service.
  def geocode_external(location)
    return Geocoder.coordinates(location)
  end
  
  #looks up location via the lookup strategy in the class's hash. this
  #method assumes that location is a non-empty CSV list
  def geocode_internal(location)
    split_location = location.split(",")
    #the location we're looking for is the first CSV
    city    = split_location[0].to_s.strip
    #but the country it's in is the last CSV -- except for the US, for
    #which it is the *state*. sigh. *sometimes* there is crap between
    #the city and country, but it's never to disambiguate
    #anything... and sometimes there is nothing there at all, so it's
    #nil
    country = split_location[-1].to_s.strip
    return lookup(city, country)
  end
  
  #converts user location to lat,lng pair using a strategy composed of
  #different geocoding methods
  def geocode(location)
    #get google geocode only if geocode from tree fails
    if location
      return geocode_internal(location) || geocode_external(location) 
    end
  end
  
  #turns degrees into radians
  def to_radians(v)
    return v * Math::PI / 180
  end
  
  #calculates the distance between two (decimal degree) lat/lng pairs
  #in miles on the surface of the earth
  def distance(dcoords1, dcoords2)
    if dcoords1.nil? || dcoords2.nil?
      return nil
    end
    rcoords1 = dcoords1.map{|sym| to_radians(sym)}
    rcoords2 = dcoords2.map{|sym| to_radians(sym)}
    del_lat  = rcoords2[0] - rcoords1[0]
    del_lng  = rcoords2[1] - rcoords1[1]
    a = Math.sin(del_lat / 2)**2 + Math.cos(rcoords1[0]) * Math.cos(rcoords2[0]) * Math.sin(del_lng / 2)**2
    c = 2 * Math.atan2(Math.sqrt(a), Math.sqrt(1 - a))
    return 3659 * c #for km this would be 6371
  end
  
  #returns true if lat,lng points c1 and c2 are "close enough",
  #whatever that means
  def close_enough?(c1, c2)
    return (distance(c1, c2) < 50) ? true : false
  end
  
